import React, { useState } from "react";
import { Link } from "react-router-dom";
import logo from "../Assets/Logo.png";
import "../Styles/style_register.css";

function Signup() {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    confirmPassword: "",
  });

  const [error, setError] = useState("");

  // Handle input change
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
  
    if (formData.password !== formData.confirmPassword) {
      setError("Passwords do not match!");
      return;
    }
  
    try {
      const existingUsersResponse = await fetch("http://localhost:5000/users");
      const users = await existingUsersResponse.json();
      
      if (users.some((user) => user.email === formData.email)) {
        setError("Email already registered!");
        return;
      }
  
      const newUser = { ...formData, password: formData.password };
      
      const response = await fetch("http://localhost:5000/users", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(newUser),
      });
  
      if (response.ok) {
        alert("User registered successfully!");
        setFormData({ firstName: "", lastName: "", email: "", password: "", confirmPassword: "" });
        setError("");
      } else {
        setError("Registration failed.");
      }
    } catch (error) {
      setError("Error connecting to server.");
    }
  };
  


  return (
    <div className="Signup">
      <div className="split leftUp">
        <div className="centre">
          <Link to="/">
            <img src={logo} alt="Logo" />
          </Link>
        </div>
      </div>
      <div className="split rightUp">
        <div className="wrapper">
          <form onSubmit={handleSubmit}>
            <div className="register-text">
              <h1>Register</h1>
            </div>

            <div className="inputbox">
              <input
                type="text"
                name="firstName"
                placeholder="First Name"
                required
                value={formData.firstName}
                onChange={handleChange}
              />
            </div>

            <div className="inputbox">
              <input
                type="text"
                name="lastName"
                placeholder="Last Name"
                required
                value={formData.lastName}
                onChange={handleChange}
              />
            </div>

            <div className="inputbox">
              <input
                type="email"
                name="email"
                placeholder="E-mail"
                required
                value={formData.email}
                onChange={handleChange}
              />
            </div>

            <div className="inputbox">
              <input
                type="password"
                name="password"
                placeholder="Password"
                required
                value={formData.password}
                onChange={handleChange}
              />
            </div>

            <div className="inputbox">
              <input
                type="password"
                name="confirmPassword"
                placeholder="Confirm Password"
                required
                value={formData.confirmPassword}
                onChange={handleChange}
              />
            </div>

            {error && <p style={{ color: "red" }}>{error}</p>}

            <button type="submit" className="bt">
              Sign Up
            </button>
          </form>

          <div className="login-link">
            Already have an account? <Link to="/login">Login</Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Signup;
